import React, { useState } from 'react';
import LogedinState from './LogedinState';

const Login = () => {
    const [isLogedIn, setIsLogedIn] = useState(false)
    return(
        <>
            <h2>Login Form</h2>
            {isLogedIn ? <LogedinState /> : <h2>User not Logedin</h2> }
        </>
    )
}

export default Login
